import React from 'react';
import './NavBar.css';

function NavBar() {
  return (
    <nav className="navbar">
      <a href="/">Home</a>
      <a href="/about">About</a>
      <a href="/contact">Contact</a>
    </nav>
  );
}

export default NavBar;
